import React, { useState, useEffect } from "react";
import axios from "axios";
import ReactMarkdown from "react-markdown";
import remarkGfm from "remark-gfm";
import { Prism as SyntaxHighlighter } from "react-syntax-highlighter";
import { materialLight } from "react-syntax-highlighter/dist/esm/styles/prism";
import "./App.css";

function App() {
  const [chats, setChats] = useState([]); // all chats
  const [currentChatId, setCurrentChatId] = useState(null); // selected chat
  const [input, setInput] = useState(""); // current user input

  // Get current chat object
  const currentChat = chats.find((chat) => chat.id === currentChatId);

  // Handle sending message
  const handleSend = async (e) => {
    e.preventDefault();
    if (!input) return;

    let chatId = currentChatId;
    let updatedChats = [...chats];

    // If no chat is selected, create a new one
    if (!chatId) {
      const newChat = {
        id: Date.now(),
        title: input.substring(0, 30) + "...", // temp title
        messages: [],
      };
      updatedChats = [newChat, ...updatedChats];
      chatId = newChat.id;
      setCurrentChatId(chatId);
    }

    // Add user message
    updatedChats = updatedChats.map((chat) => {
      if (chat.id === chatId) {
        return { ...chat, messages: [...chat.messages, { role: "user", content: input }] };
      }
      return chat;
    });

    setChats(updatedChats);
    setInput("");

    // Fetch static response
    try {
      const res = await axios.get("http://localhost:3000/api/generate");
      const botMessage = { role: "bot", content: res.data.generated };

      setChats((prevChats) =>
        prevChats.map((chat) =>
          chat.id === chatId ? { ...chat, messages: [...chat.messages, botMessage] } : chat
        )
      );
    } catch (err) {
      console.error(err);
      const errorMessage = { role: "bot", content: "Error generating code." };
      setChats((prevChats) =>
        prevChats.map((chat) =>
          chat.id === chatId ? { ...chat, messages: [...chat.messages, errorMessage] } : chat
        )
      );
    }
  };

  // Create a new chat manually
  const handleNewChat = () => {
    const newChat = { id: Date.now(), title: "New Chat", messages: [] };
    setChats([newChat, ...chats]);
    setCurrentChatId(newChat.id);
    setInput("");
  };

  // Select a chat from sidebar
  const handleSelectChat = (id) => {
    setCurrentChatId(id);
    setInput("");
  };

  // Update chat title (editable)
  const handleTitleChange = (id, newTitle) => {
    setChats((prevChats) =>
      prevChats.map((chat) => (chat.id === id ? { ...chat, title: newTitle } : chat))
    );
  };

  return (
    <div className="app-container">
      <div className="sidebar">
        <button className="new-chat-btn" onClick={handleNewChat}>
          + New Chat
        </button>
        {chats.map((chat) => (
          <div
            key={chat.id}
            className={`chat-item ${chat.id === currentChatId ? "selected" : ""}`}
            onClick={() => handleSelectChat(chat.id)}
          >
            <input
              value={chat.title}
              onChange={(e) => handleTitleChange(chat.id, e.target.value)}
              className="chat-title-input"
            />
          </div>
        ))}
      </div>

      <div className="chat-area">
        <div className="messages">
          {currentChat?.messages.map((msg, idx) => (
            <div
              key={idx}
              className={`message ${msg.role === "user" ? "user-message" : "bot-message"}`}
            >
              {msg.role === "bot" ? (
                <ReactMarkdown
                  children={msg.content}
                  remarkPlugins={[remarkGfm]}
                  components={{
                    code({ node, inline, className, children, ...props }) {
                      return !inline ? (
                        <SyntaxHighlighter
                          style={materialLight}
                          language="javascript"
                          {...props}
                        >
                          {String(children).replace(/\n$/, "")}
                        </SyntaxHighlighter>
                      ) : (
                        <code className={className} {...props}>
                          {children}
                        </code>
                      );
                    },
                  }}
                />
              ) : (
                <span>{msg.content}</span>
              )}
            </div>
          ))}
        </div>

        <form className="input-form" onSubmit={handleSend}>
          <input
            type="text"
            placeholder="Type your message..."
            value={input}
            onChange={(e) => setInput(e.target.value)}
          />
          <button type="submit">Send</button>
        </form>
      </div>
    </div>
  );
}

export default App;
